import React from 'react';
import Work from '../../Work';
import WorkReverse from '../../WorkReverse';
import {homeObjOne, recentWorkOne, recentWorkTwo, recentWorkThree} from './Data';


function Portfolio() {
    return (  
        <>
            <section>
                <div className="header-container">
                    <div className="interests-text-wrapper">
                        <div className="interests-header-wrapper">
                            <h1 className="other">
                                all
                            </h1>
                            <h1 className="works">
                                works
                            </h1>
                        </div>
                        
                        <h3 className="interests-subtitle">
                            aBeautifulObsession
                        </h3>
                    </div>
                </div>
            </section>
            <Work {...recentWorkOne} />
            <WorkReverse {...recentWorkTwo} />
            <Work {...recentWorkThree} />
        </>
    );
}

export default Portfolio;
